import React from 'react';
import { TextField } from '@mui/material';

const OrderNumberInput = ({ value, onChange }) => {
  return (
    <TextField
      value={value}
      onChange={(e) => onChange(e.target.value)}
      variant="outlined"
      size="small"
      fullWidth
      placeholder="Номер заказа"
    />
  );
};

export default OrderNumberInput;
